import styled from 'styled-components/native';

export const Container = styled.View`
width: 100%;
height: 100%;
align-items: center;
justify-content: center;
background-color: #dbdbdb;
`;

export const Touchable = styled.TouchableOpacity`
background-color: #fff;
`;
